import { Component } from "react";
import React from "react";
import { PageMain,SimpleGrid } from "core";
import NotificationSystem from "react-notification-system";
import Constants from '../../utils/constants';

export default class ReceiveCTRListPage extends Component
{
    constructor(props)
    {
        super(props);

        this.state = {
            isLoading: false
        };

        this.notificationSystem = React.createRef();
        this.nameForm="دریافت CTR";
        this.urlGrid="/api/amls/bi/ReceiveCTR/SearchReceiveCTR";
    }

    // Events.
    render()
    {
        return (
            <>
                <PageMain context={ this } title={this.nameForm}icon="list-search" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                topButtons={[]}>
                <div className="card">
                    <div className="card-body">
                     <SimpleGrid context={ this } dataKey="nationalNumber" minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox={ false } hideExportButton
                    filterBgColor="primary" name="crdsusList" title={this.nameForm} notificationSystem={ this.notificationSystem }
                    enableAutoFetch
                    listApiUrl={this.urlGrid}
                    headers={[
                        { title: "نام مشتری", name: "customerName" },
                        { title: "شماره مشتری", name: "customerNumber" },
                        { title: "کد ملی/ شناسه ملی/کد فراگیر اتباع", name: "nationalNumber" },
                        { title: "شاخص های پیدا شده", name: "foundRoles" },
                        { title: "تعداد شاخص ها پیدا شده", name: "foundRolesCount" },
                    ]}
                    filterOptions={[
                            { type: 'text', name: 'customerNumber', title: 'شماره مشتری' },
                            { type: 'text', name: 'nationalNumber', title: 'کد ملی/ شناسه ملی/کد فراگیر اتباع' }
                    ]}
                    />
                    </div>
                    <div className="card-footer">
                        <div className="d-flex">
                            <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => this.Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                بازگشت
                            <i className="ti ti-arrow-left ms-1"></i>
                            </a>
                        </div>
                    </div>
                </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
